var UserProfile = (function() {
	var full_name = "";
	var SSID = "";

	var getName = function() {
		return full_name;
	};

	var setName = function(name) {
		full_name = name;
	};

	var getSSID = function() {
		return SSID;
	};



	return {
		getName: getName,
		setName: setName
	}

})();

export default UserProfile;
